import '../App.css';
import React from 'react';



function Blog() {

return(
	<div className="App-total">
		<header className="App-total">

	<h1>Pobbleblog</h1>

	<h2>There is no real structure to this.</h2>
		</header>

		<body className="App-body">
			<h3> 1/1/22 - Happy New Year from Michigan!  I'm still trying to figure out what I'll end up putting here.  I think I'm drawn to Shawn Wang's concept of "Learning in Public."  Mostly because I've learned so much from other developers who have done the same.  In fact I'm still to this day shocked at how easy it is to find tutorials/blog posts/and real live help from people for free online.  I feel a bit indebted in that sense and would love to help anyone out who could somewhat benefit from me.</h3>
			<h3>To start off I want to say flat out that I know everything that you see here is a work in progress.  I know even this blog could be styled better.  But this is what I hope is a multi-year project that I just chip away at in my freetime and should look like a more put together package as I get more time.</h3><h3> The app is fully functional as noted before and I was going to start giving it away to a select few comedians but in waiting for the ball to drop last night I downloaded the latest version on my phone and saw a bug and I want to work that out.  I plan on heading back to Miami towards the end of the month and will be more active in distributing the beta release by then.  I'll also be networking quite a bit in the #MiamiTech scene because I'm going to have to pivot my attention a little bit away from programming to the actual rolling out of the project and all the issues involved with that.  I don't come from the tech world in my work nor my college studies so I feel like I'm in my freshman year of college on this stuff.  So far I've just been watching Silicon Valley on HBO Max.  </h3>
			<h3>12/26/21 - The app is fully functional.  For the website I'm still working on building the table migration.</h3>

		</body>
	</div>
);
}


export default Blog;
